import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {


  const API_KEY = '10f5fc043a0815d3b2db734dd151a90a';
  const url = "https://api.openweathermap.org/data/2.5/weather?q=${Buenos Aires}&appid=${API_KEY}&units=metric"
  const [cityarg, setCityArg] = useState('Buenos Aires')
  const [city, setCity] = useState(cityarg);


  useEffect(() => {
    axios.get(url)
  }, [] )

  const fetchData = () => {
    const data = axios.get(`https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${API_KEY}&units=metric`)
    console.log(data)
  }



  return (
    <div className="App">
      <button onClick={fetchData}>Comenzar</button>
    </div>
  );
}

export default App;
